var fgdata = ' data:image/png;base64,'

var bgdata = ' data:image/png;base64,'

var WINDOW_WIDTH = window.innerWidth
var WINDOW_HEIGHT = window.innerHeight
var FG = 'background: url('+ fgdata +') no-repeat center center fixed;'
var BG = 'background: url('+ bgdata +') no-repeat center center fixed;'

window.addEventListener('mousemove', checkFg)
window.addEventListener('touchmove', checkFg)
var audio = new Audio('29.mp3');

function checkFg (e) {
  if (e.clientX > WINDOW_WIDTH * 0.55 && e.clientX) {
    audio.play();
    document.body.style = FG
    document.body.style.backgroundSize = 'cover'
  } else {
    document.body.style = BG
    document.body.style.backgroundSize = 'cover'
  }
}

document.body.style = BG
document.body.style.backgroundSize = 'cover'

